import React, { Component } from 'react';


class SignUp extends Component {
    constructor(props) {
        super(props);
        this.state = {
            first_name: '',
            last_name: '',
            email: '',
            password: ''
        }
        this.handleClick = this.handleClick.bind(this);
    }
    handleClick(event) {
        event.preventDefault();
        this.props.history.push(`/home`);
    }

    render() {
        return (
            <form action="#" method="post">
                <div id="signup">
                    <div className="field  half first">
                        <label for="first">First Name
                        <input type="text" id="first" placeholder="First Name" />
                        </label></div>
                    <div className="field half">
                        <label for="last">Last Name
                        <input type="text" id="last" placeholder="Last Name" /></label></div>
                    <div className="field ">
                        <label for="email">Email
                        <input type="email" id="email" placeholder="Email" /></label></div>
                    <div className="field">
                        <label for="password">Password
                        <input type="password" id="password" placeholder="Password" /></label></div>
                    <div className="field ">
                        <label for="confirm">Confirm Password
                        <input type="password" id="password" placeholder="Confirm Password" /></label></div>
                        <div className="field">
                      <input value="Send Message" className="button alt" type="submit" />
                    </div>
                </div>
            </form>
        )
    }
}


export default SignUp;
